import React from "react";
import "./Sidebar.css";
import Logo from "../assets/Logo.jpeg";

function Sidebar() {
  return (
    <div className="sidebar">
      <img src={Logo} />
      <div className="home-button">HOME</div>
    </div>
  );
}
export default Sidebar;
